import {FORM_TITLE} from './locales'

const RegisterForm = () => {
    const I18n = useI18n()

    return (
        <C>
            {I18n.t(FORM_TITLE)}
            <form>
                <div>
                    <label>First Name</label>
                    <input type="text"/>
